        children: "\u041D\u0430\u043A\u043E\u043D\u0435\u0446, \u043C\u044B \u043E\u043F\u0438\u0448\u0435\u043C \u043D\u0435\u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0434\u043E\u043F\u043E\u043B\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u0438, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0432\u044B \u043D\u0430\u0439\u0434\u0435\u0442\u0435 \u043F\u0440\u0438 \u043E\u0444\u043E\u0440\u043C\u043B\u0435\u043D\u0438\u0438 \u0437\u0430\u043A\u0430\u0437\u0430. \u041C\u044B \u043E\u0442\u0432\u0435\u0442\u0438\u043C \u043D\u0430 \u0432\u0430\u0448\u0438 \u0432\u043E\u043F\u0440\u043E\u0441\u044B \u043E \u0441\u043F\u043E\u0441\u043E\u0431\u0430\u0445 \u043E\u043F\u043B\u0430\u0442\u044B \u0438 \u043E \u0442\u043E\u043C, \u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0432\u0440\u0435\u043C\u0435\u043D\u0438 \u0437\u0430\u043D\u0438\u043C\u0430\u0435\u0442 \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u0435. \u0412 \u043F\u0435\u0440\u0432\u0443\u044E \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u043E\u0431\u0440\u0430\u0442\u0438\u0442\u0435 \u0432\u043D\u0438\u043C\u0430\u043D\u0438\u0435 \u043D\u0430 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u043E \u0430\u043A\u043A\u0430\u0443\u043D\u0442\u043E\u0432, \u0441 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u0442\u0441\u044F \u043A\u0430\u043C\u043F\u0430\u043D\u0438\u044F. \u0412 \u0441\u0432\u044F\u0437\u0438 \u0441 \u0442\u0435\u043C, \u0447\u0442\u043E \u043D\u0435 \u0432\u0441\u0435 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u0438 \u0437\u0430\u0431\u043E\u0442\u044F\u0442\u0441\u044F \u043E \u0440\u0435\u0430\u043B\u044C\u043D\u044B\u0445 \u043A\u043E\u043C\u043C\u0435\u043D\u0442\u0430\u0440\u0438\u044F\u0445, \u043C\u044B \u0442\u0430\u043A\u0436\u0435 \u0432\u0432\u0435\u043B\u0438 \u043F\u0440\u043E\u0444\u0438\u043B\u0438 \u0431\u043E\u043B\u0435\u0435 \u043D\u0438\u0437\u043A\u043E\u0433\u043E \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u0430. \u0420\u0435\u0448\u0438\u0442\u0435 \u0434\u043B\u044F \u0441\u0435\u0431\u044F, \u0447\u0442\u043E \u0432\u0430\u0441 \u0431\u043E\u043B\u044C\u0448\u0435 \u0432\u043E\u043B\u043D\u0443\u0435\u0442, \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u043E \u0438\u043B\u0438 \u0446\u0435\u043D\u0430? \u041A\u0430\u043A \u0438 \u0432 \u0441\u043B\u0443\u0447\u0430\u0435 \u0441 \u043E\u0441\u0442\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u0443\u0441\u043B\u0443\u0433\u0430\u043C\u0438 \u043D\u0430 \u043D\u0430\u0448\u0435\u043C \u0441\u0430\u0439\u0442\u0435, \u0432\u044B \u043C\u043E\u0436\u0435\u0442\u0435 \u043A\u0443\u043F\u0438\u0442\u044C \u043A\u043E\u043C\u043C\u0435\u043D\u0442\u0430\u0440\u0438\u0438 \u0432 Instagram, \u0437\u0430\u043F\u043B\u0430\u0442\u0438\u0432: \u0431\u044B\u0441\u0442\u0440\u044B\u043C \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u043E\u043C \u0438\u0437 \u043B\u044E\u0431\u043E\u0433\u043E \u0431\u0430\u043D\u043A\u0430 \u0438\u043B\u0438 \u043F\u043E SMS! \u041A\u0440\u043E\u043C\u0435 \u0442\u043E\u0433\u043E, \u0435\u0441\u043B\u0438 \u0432\u044B \u0445\u043E\u0442\u0438\u0442\u0435 \u0431\u043E\u043B\u0435\u0435 \u0431\u044B\u0441\u0442\u0440\u043E\u0435 \u0432\u043D\u0435\u0434\u0440\u0435\u043D\u0438\u0435 \u0438\u043B\u0438 \u043F\u043E\u0441\u0442\u0435\u043F\u0435\u043D\u043D\u043E\u0435 \u0434\u043E\u0431\u0430\u0432\u043B\u0435\u043D\u0438\u0435, \u0432\u044B \u0442\u0430\u043A\u0436\u0435 \u043C\u043E\u0436\u0435\u0442\u0435 \u0432\u044B\u0431\u0440\u0430\u0442\u044C \u044D\u0442\u0438 \u0434\u043E\u043F\u043E\u043B\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u043F\u0430\u0440\u0430\u043C\u0435\u0442\u0440\u044B."
